import styled from "styled-components";
import { Logo } from "../../components/logo/Logo";
import { FooterMenu } from "./footerMenu/FooterMenu";
import { Button } from "../../components/button/Button";
import { Icon } from "../../components/icon/Icon";
import { Link } from "../../components/link/Link";
import { theme } from "../../styles/Theme";

const footerItems = ["Projects", "About", "Digital Assets"];

export function Footer() {
	return (
		<StyledFooter>
			<Wapper>
				<LeftBox>
					<Logo />
					<FooterMenu menuItems={footerItems} />
				</LeftBox>
				<RightBox>
					<Text>Subscribe to my emailing list</Text>
					<Form placeholder="Enter your email" />
					<Button type={"submit"}>Subscribe</Button>
					<Privacy>
						By subscribing you agree to with our
						<Link href="">Privacy Policy</Link>
					</Privacy>
				</RightBox>
			</Wapper>
			<BottomBox>
				<TextWrapper>2024 Relume. All right reserved.</TextWrapper>
				<IconWrapper>
					<Icon iconId="" />
					<Icon iconId="" />
					<Icon iconId="" />
					<Icon iconId="" />
				</IconWrapper>
			</BottomBox>
		</StyledFooter>
	);
}

const StyledFooter = styled.section`
	background-color: ${theme.color.secondaryBg};
	width: 1440px;
	height: 434px;
`;

const Text = styled.span`
	font-size: 16px;
	font-weight: 700;
	line-height: 150%;
`;

const Form = styled.input``;

const Privacy = styled.p``;

const LeftBox = styled.div`
	outline: 1px solid red;
	display: flex;
	height: 94px;
	flex-direction: column;
	justify-content: space-between;
	align-items: start;
	font-size: 16px;
	font-weight: 400;
	line-height: 150%;
`;

const RightBox = styled.div`
	width: 400px;
	height: 122px;
	outline: 1px solid red;

	& ${Button} {
		font-size: 16px;
		font-weight: 00;
		line-height: 150%;
	}
`;

const TextWrapper = styled.div`
	width: 198px;
	height: 21px;
`;
const BottomBox = styled.div`
	outline: 3px solid red;
	display: flex;
	justify-content: space-around;
`;
const IconWrapper = styled.div``;

const Wapper = styled.div`
	outline: 1px solid red;
	width: 1064px;
	height: 124px;
	margin: 80px 188px 0;
	display: flex;
	justify-content: space-between;
`;
